import React from 'react';
import './NavBar.css';

const NavBar = () => {
    // const homepng = require('./../../../images/home.png'); 
    // with require
    return(
        <>
        <body id="body">
        <nav>

<div id="uppernav">
        
        <div></div>
</div>
            <div id="bottomnav">
             <div className="navflex">
                {/* <img src={homepng}></img> */}
                <a href="/Home" className="Home">HOME</a>
                </div>
            <div className="navflex">
                <a href="/Analysis" className="analysisclass">ANALYSIS</a>
                </div>
                <div className="navflex">
                <a href="/Dashboard" className="dashboardclass">DASHBOARD</a>
                </div>
                {/* <div className="navflex">
                <a href="BELOW OPTIONS">ffeef</a>
                </div> */}
                <div className="navflex">
                <a href="/UploadUsingDropzoneContainer">DROPZONE</a>
                </div>
                </div>
                
        </nav>
        </body>
        </>
    )
}
export default NavBar;
